import React from "react";
import { Link } from "react-router-dom";

class ImageModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = { module: props.module };
  }
  render() {
    console.log(this.state);
    return <h1>HELLO</h1>;
  }
}

export default ImageModule;
